import React, { useState } from 'react';
import { Course, getPrerequisites, getCorequisites, courses } from '../data/courses.ts';

interface FlowchartProps {
  selectedCourse: Course | null;
  onCourseClick: (course: Course) => void;
}

const Flowchart: React.FC<FlowchartProps> = ({ selectedCourse, onCourseClick }) => {
  const [hoveredCourse, setHoveredCourse] = useState<Course | null>(null);

  // Get courses organized by year and semester
  const getCoursesByYearAndSemester = () => {
    const organized: { [key: string]: Course[] } = {};

    courses.forEach(course => {
      const semesterKey = `Year ${course.year} ${course.semester}`;
      if (!organized[semesterKey]) {
        organized[semesterKey] = [];
      }
      organized[semesterKey].push(course);
    });

    // Sort semesters in chronological order
    const sortedKeys = Object.keys(organized).sort((a, b) => {
      const yearA = parseInt(a.split(' ')[1]);
      const yearB = parseInt(b.split(' ')[1]);
      if (yearA !== yearB) return yearA - yearB;
      return a.includes('Fall') ? -1 : 1;
    });

    return sortedKeys.map(key => ({ semester: key, courses: organized[key] }));
  };

  const semesterData = getCoursesByYearAndSemester();

  const getCourseHighlightColor = (course: Course) => {
    if (!hoveredCourse) return 'bg-white border-gray-200';

    // Check if this course is a prerequisite of the hovered course
    const prerequisites = getPrerequisites(hoveredCourse.id);
    const isPrerequisite = prerequisites.some(prereq => prereq.id === course.id);

    // Check if this course is a corequisite of the hovered course
    const corequisites = getCorequisites(hoveredCourse.id);
    const isCorequisite = corequisites.some(coreq => coreq.id === course.id);

    // Check if this course has the hovered course as a prerequisite
    const hasHoveredAsPrerequisite = getPrerequisites(course.id).some(prereq => prereq.id === hoveredCourse.id);

    if (isPrerequisite) return 'bg-amber-50 border-amber-300 shadow-amber-100';
    if (isCorequisite) return 'bg-blue-50 border-blue-300 shadow-blue-100';
    if (hasHoveredAsPrerequisite) return 'bg-rose-50 border-rose-300 shadow-rose-100';
    if (course.id === hoveredCourse.id) return 'bg-amber-50 border-amber-400 shadow-amber-200';

    return 'bg-white border-gray-200';
  };

  return (
    <div className="w-full h-full overflow-auto bg-gradient-to-br from-slate-50 via-blue-50 to-indigo-50">
      {/* Header with Legend */}
      <div className="sticky top-0 z-10 bg-white/80 backdrop-blur-sm border-b border-gray-200 shadow-sm">
        <div className="max-w-6xl mx-auto px-8 py-6">
          <div className="flex items-center justify-between">
            <div>
              <h1 className="text-2xl font-bold text-gray-900 mb-2">Course Timeline</h1>
              <p className="text-gray-600">Hover over courses to see relationships</p>
            </div>

            {/* Legend */}
            <div className="flex items-center space-x-8">
              <div className="flex items-center space-x-2">
                <div className="w-3 h-3 bg-amber-100 border border-amber-300 rounded-sm"></div>
                <span className="text-sm text-gray-700">Prerequisites</span>
              </div>
              <div className="flex items-center space-x-2">
                <div className="w-3 h-3 bg-blue-100 border border-blue-300 rounded-sm"></div>
                <span className="text-sm text-gray-700">Corequisites</span>
              </div>
              <div className="flex items-center space-x-2">
                <div className="w-3 h-3 bg-rose-100 border border-rose-300 rounded-sm"></div>
                <span className="text-sm text-gray-700">Following Courses</span>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Flowchart Content */}
      <div className="p-8">
        <div className="flex gap-12 min-w-max">
          {semesterData.map((semester) => (
            <div key={semester.semester} className="flex-shrink-0">
              {/* Semester Header */}
              <div className="text-center mb-8">
                <div className="inline-flex items-center px-6 py-3 bg-white rounded-full border border-gray-200 shadow-sm">
                  <h3 className="text-lg font-semibold text-gray-900">{semester.semester}</h3>
                </div>
              </div>

              {/* Course Cards */}
              <div className="space-y-5">
                {semester.courses.map((course) => {
                  const highlightClass = getCourseHighlightColor(course);

                  return (
                    <div
                      key={course.id}
                      className={`w-72 p-5 rounded-xl border shadow-sm cursor-pointer transition-all duration-300 hover:shadow-md hover:scale-[1.02] ${highlightClass}`}
                      onMouseEnter={() => setHoveredCourse(course)}
                      onMouseLeave={() => setHoveredCourse(null)}
                      onClick={() => onCourseClick(course)}
                    >
                      <div className="flex items-start justify-between mb-3">
                        <div className="font-bold text-gray-900 text-lg">{course.code}</div>
                        <div className="text-xs font-medium text-gray-500 bg-gray-100 px-2 py-1 rounded-full">
                          {course.units} units
                        </div>
                      </div>
                      <div className="text-sm text-gray-700 leading-relaxed">{course.name}</div>
                    </div>
                  );
                })}
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Flowchart;
